template <typename T>
void print_vec(const std::vector<T>& v) {
	for (const T& vv : v) {
		cout << vv << ' ';
	}
	cout << endl;
}

vector<vector<int>> merge(vector<vector<int>>& intervals) {

	stable_sort(intervals.begin(), intervals.end(), [](const vector<int>& a, const vector<int>& b) {return a[0] < b[0]; });

	auto it = intervals.cbegin();
	vector<vector<int>> res;
	while (it != intervals.cend())
	{
		int left_bound = (*it)[0];
		int right_bound = (*it)[1];
		auto it2 = it;
		advance(it2, 1);

		while ((it2 != intervals.cend()) && (right_bound >= (*it2)[0]))
		{
			right_bound = max(right_bound, (*it2)[1]);
			//     ++it;
			++it2;
		}

		//   int left_bound = (*it){0};
		//   int right_bound = (*it){1};
		 //  while (((*it2){0} <= right_bound && (*it2){1} >= left_bound)&& ++it2 != intervals.cend());
		res.push_back({ left_bound, right_bound });
		/*
		if (it2 != intervals.cend())
		{
			res.push_back({(*it){0}, (*--it2){1}});
		} else {

			res.push_back({(*it){0}, (*--it2){1}});

		}
		*/
		it = it2;
	}
	return res;
}

