class Solution_max1 {

public:
	vector<int> maxSlidingWindow(vector<int>& nums, int k) {
		vector<int> res(nums.size() - k + 1);
		//res.reserve(nums.size() - k + 1);

		auto it = nums.begin();
		auto it_res = res.begin();

		int prev_max = INT_MIN;

		vector<int> temp(k);
		//temp.reserve(k);
		while (distance(it, nums.end()) >= k)
		{

			//	vector<int> temp;
			//	temp.reserve(k);
			if (distance(it_res, res.end()) < k)
			{

				copy(it, it + k, temp.begin());
				nth_element(temp.begin(), temp.begin(), temp.end(), greater{});
				*it_res++ = *temp.begin();
				++it;
				continue;
			}
			copy(it, it + k, it_res);

			nth_element(it_res, it_res, it_res + k, greater{});
				res.push_back(*temp.begin());

			++it;
			++it_res;
		}
		return res;
	}
};

